import React, { useState, useEffect, useRef } from 'react';
import {
  Box,
  TextField,
  Button,
  Paper,
  Typography,
  Container,
  CircularProgress,
  Card,
  CardContent,
  CardActions,
  Chip,
  Divider,
  Alert,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Grid,
  Avatar,
  List,
  ListItem,
  ListItemText,
  Snackbar,
  Badge,
  Tooltip,
  IconButton
} from '@mui/material';
import RealEstateService from '../services/realEstateService';

const ChatInterface = () => {
  console.log('ðŸŽ¨ =================================');
  console.log('ðŸŽ¨ CHAT INTERFACE COMPONENT LOADING');
  console.log('ðŸŽ¨ =================================');
  
  const [messages, setMessages] = useState([]);
  const [input, setInput] = useState('');
  const [loading, setLoading] = useState(false);
  const [properties, setProperties] = useState([]);
  const [selectedProperty, setSelectedProperty] = useState(null);
  const [showPropertyDetails, setShowPropertyDetails] = useState(false);
  const [snackbar, setSnackbar] = useState({ open: false, message: '', severity: 'info' });
  const [searchSuggestions, setSearchSuggestions] = useState([]);
  const messagesEndRef = useRef(null);

  console.log('ðŸŽ¨ Component state initialized');
  console.log('ðŸŽ¨ RealEstateService available:', !!RealEstateService);

  const scrollToBottom = () => {
    console.log('ðŸ“œ Scrolling to bottom');
    messagesEndRef.current?.scrollIntoView({ behavior: "smooth" });
  };

  useEffect(() => {
    console.log('ðŸ“œ Messages updated, scrolling to bottom');
    scrollToBottom();
  }, [messages]);

  useEffect(() => {
    console.log('ðŸŽ¬ ChatInterface mounted, adding welcome message');
    const welcomeMessage = {
      id: 1,
      text: "ðŸ‘‹ Welcome to AI Real Estate Assistant! I'm here to help you find your perfect home.\n\nðŸ  I can help you with:\nâ€¢ Property searches with smart filtering\nâ€¢ Detailed amenities information\nâ€¢ Price negotiations\nâ€¢ Deal closing process\n\nTry asking: 'Find 2BHK apartments in Dallas under $500K'",
      sender: 'agent',
      timestamp: new Date().toISOString(),
      type: 'welcome'
    };
    
    console.log('ðŸŽ¬ Welcome message created:', welcomeMessage);
    setMessages([welcomeMessage]);
  }, []);

  const handleSubmit = async (e) => {
    console.log('ðŸ“ =================================');
    console.log('ðŸ“ FORM SUBMIT STARTED');
    console.log('ðŸ“ =================================');
    
    e.preventDefault();
    console.log('ðŸ“ Event prevented');
    console.log('ðŸ“ Current input value:', input);
    console.log('ðŸ“ Input trimmed:', input.trim());
    
    if (!input.trim()) {
      console.log('âš ï¸ Empty input, returning early');
      return;
    }

    console.log('ðŸ“ Creating user message...');
    const userMessage = {
      id: messages.length + 1,
      text: input,
      sender: 'user',
      timestamp: new Date().toISOString(),
    };
    console.log('ðŸ“ User message created:', userMessage);

    console.log('ðŸ“ Updating messages state...');
    setMessages((prev) => {
      console.log('ðŸ“ Previous messages:', prev);
      const newMessages = [...prev, userMessage];
      console.log('ðŸ“ New messages array:', newMessages);
      return newMessages;
    });
    
    const currentInput = input;
    console.log('ðŸ“ Saving current input:', currentInput);
    console.log('ðŸ“ Clearing input field...');
    setInput('');
    
    console.log('ðŸ“ Setting loading to true...');
    setLoading(true);

    try {
      console.log('ðŸš€ Starting API call...');
      console.log('ðŸš€ Calling RealEstateService.chatQuery with:', currentInput);
      
      // Call the service
      const response = await RealEstateService.chatQuery(currentInput);
      
      console.log('âœ… API call completed');
      console.log('âœ… Response received:', response);
      console.log('âœ… Response status:', response.status);
      console.log('âœ… Response message:', response.message);
      console.log('âœ… Response data:', response.data);
      
      const agentMessage = {
        id: messages.length + 2,
        text: response.message || "I'm processing your request...",
        sender: 'agent',
        timestamp: new Date().toISOString(),
        data: response.data,
        status: response.status
      };
      console.log('ðŸ¤– Agent message created:', agentMessage);

      console.log('ðŸ“ Adding agent message to state...');
      setMessages((prev) => {
        console.log('ðŸ“ Previous messages before agent response:', prev);
        const newMessages = [...prev, agentMessage];
        console.log('ðŸ“ Messages after agent response:', newMessages);
        return newMessages;
      });

      // Enhanced property handling
      console.log('ðŸ  Checking for properties in response...');
      if (response.data?.properties && response.data.properties.length > 0) {
        console.log('ðŸ  Exact match properties found:', response.data.properties.length);
        console.log('ðŸ  First property:', response.data.properties[0]);
        
        const processedProperties = response.data.properties.map(p => ({ 
          ...p, 
          showAmenities: false,
          negotiationStatus: 'none',
          isExactMatch: true
        }));
        console.log('ðŸ  Processed properties:', processedProperties);
        
        setProperties(processedProperties);
        setSearchSuggestions([]);
        console.log('ðŸ  Properties state updated');
        
      } else if (response.data?.alternative_count > 0) {
        // Handle alternative properties when no exact matches
        console.log('ðŸ  No exact matches, but alternatives available:', response.data.alternative_count);
        console.log('ðŸ  Suggestions:', response.data.suggestions);
        
        // Store suggestions for display
        setSearchSuggestions(response.data.suggestions || []);
        
        // Try to get some alternative properties automatically
        await fetchAlternativeProperties(currentInput, response.data);
        
      } else {
        console.log('ðŸ  No properties found in response');
        setProperties([]);
        setSearchSuggestions(response.data?.suggestions || []);
      }

      // Show success/error snackbar
      if (response.status === 'error') {
        console.log('âš ï¸ Error response detected, showing snackbar');
        setSnackbar({ 
          open: true, 
          message: 'Something went wrong. Please try again.', 
          severity: 'error' 
        });
      } else {
        console.log('âœ… Success response detected');
      }

    } catch (error) {
      console.log('ðŸ’¥ =================================');
      console.log('ðŸ’¥ HANDLE SUBMIT ERROR');
      console.log('ðŸ’¥ =================================');
      console.error('ðŸ’¥ Caught error in handleSubmit:', error);
      console.error('ðŸ’¥ Error name:', error.name);
      console.error('ðŸ’¥ Error message:', error.message);
      console.error('ðŸ’¥ Error stack:', error.stack);
      
      const errorMessage = {
        id: messages.length + 2,
        text: 'âŒ Sorry, I encountered an error. Please try again or rephrase your question.',
        sender: 'agent',
        timestamp: new Date().toISOString(),
        status: 'error'
      };
      console.log('ðŸ’¥ Error message created:', errorMessage);
      
      setMessages((prev) => [...prev, errorMessage]);
      
      setSnackbar({ 
        open: true, 
        message: 'Connection error. Please check your internet and try again.', 
        severity: 'error' 
      });
    } finally {
      console.log('ðŸ Setting loading to false...');
      setLoading(false);
      console.log('ðŸ Handle submit completed');
    }
  };

  const fetchAlternativeProperties = async (originalQuery, responseData) => {
    try {
      console.log('ðŸ”„ Fetching alternative properties...');
      
      // Generate alternative queries based on the original
      const alternativeQueries = generateAlternativeQueries(originalQuery, responseData);
      
      for (const altQuery of alternativeQueries) {
        console.log('ðŸ”„ Trying alternative query:', altQuery);
        
        const altResponse = await RealEstateService.chatQuery(altQuery);
        
        if (altResponse.data?.properties && altResponse.data.properties.length > 0) {
          console.log('ðŸ  Alternative properties found:', altResponse.data.properties.length);
          
          const altProperties = altResponse.data.properties.map(p => ({ 
            ...p, 
            showAmenities: false,
            negotiationStatus: 'none',
            isAlternative: true
          }));
          
          setProperties(altProperties);
          
          // Add an info message about alternatives
          const altMessage = {
            id: Date.now(), // Use timestamp for unique ID
            text: `ðŸ’¡ Since no exact matches were found, here are ${altProperties.length} similar properties that might interest you:`,
            sender: 'agent',
            timestamp: new Date().toISOString(),
            type: 'alternatives'
          };
          
          setMessages(prev => [...prev, altMessage]);
          break; // Stop after finding the first successful alternative
        }
      }
    } catch (error) {
      console.log('âŒ Error fetching alternatives:', error);
    }
  };

  const generateAlternativeQueries = (originalQuery, responseData) => {
    const alternatives = [];
    
    // If San Francisco, try other CA cities
    if (originalQuery.toLowerCase().includes('san francisco')) {
      alternatives.push(originalQuery.replace(/san francisco/i, 'Los Angeles'));
      alternatives.push(originalQuery.replace(/san francisco/i, 'San Diego'));
    }
    
    // If under certain price, try higher prices
    if (originalQuery.includes('$500K') || originalQuery.includes('500K')) {
      alternatives.push(originalQuery.replace(/\$?500K|\$?500,000/i, '$600K'));
      alternatives.push(originalQuery.replace(/\$?500K|\$?500,000/i, '$700K'));
    }
    
    // Try different cities entirely
    alternatives.push(originalQuery.replace(/in \w+( \w+)?/, 'in Dallas'));
    alternatives.push(originalQuery.replace(/in \w+( \w+)?/, 'in Houston'));
    alternatives.push(originalQuery.replace(/under \$\d+K?/, 'under $600K'));
    
    // Generic fallback
    if (alternatives.length === 0) {
      alternatives.push('Show me 2 bedroom apartments under $600K');
      alternatives.push('Find available apartments with 2 bedrooms');
    }
    
    return alternatives.slice(0, 3); // Limit to 3 alternatives
  };

  const handlePropertyAction = async (property, action, data = {}) => {
    console.log('ðŸ  =================================');
    console.log('ðŸ  PROPERTY ACTION STARTED');
    console.log('ðŸ  =================================');
    console.log('ðŸ  Property:', property);
    console.log('ðŸ  Action:', action);
    console.log('ðŸ  Data:', data);
    
    try {
      let response;
      
      switch (action) {
        case 'showAmenities':
          console.log('ðŸ¢ Fetching amenities for property:', property.id);
          response = await RealEstateService.getPropertyAmenities(property.id);
          console.log('ðŸ¢ Amenities response:', response);
          
          if (response.status === 'success') {
            console.log('ðŸ¢ Updating property amenities in state');
            setProperties(prev => prev.map(p =>
              p.id === property.id
                ? { ...p, showAmenities: !p.showAmenities, amenitiesData: response.data }
                : p
            ));
          }
          break;
          
        case 'makeOffer':
          const suggestedOffer = Math.round(property.price * 0.95);
          console.log('ðŸ’° Making offer:', suggestedOffer);
          setInput(`I want to make an offer of $${suggestedOffer.toLocaleString()} for property ${property.id}`);
          break;

        case 'negotiate':
          console.log('ðŸ’° Processing negotiation for property:', property.id);
          const offerAmount = data.offer || Math.round(property.price * 0.95);
          response = await RealEstateService.negotiatePrice(property.id, offerAmount);
          console.log('ðŸ’° Negotiation response:', response);
          
          if (response.status === 'success') {
            console.log('ðŸ’° Updating negotiation status');
            setProperties(prev => prev.map(p =>
              p.id === property.id
                ? { ...p, negotiationStatus: response.data.negotiation_status, negotiationData: response.data }
                : p
            ));
            
            const negotiationMessage = {
              id: Date.now(),
              text: response.message,
              sender: 'agent',
              timestamp: new Date().toISOString(),
              data: response.data,
              type: 'negotiation'
            };
            setMessages(prev => [...prev, negotiationMessage]);
          }
          break;
          
        case 'closeDeal':
          console.log('ðŸ¤ Closing deal for property:', property.id);
          response = await RealEstateService.finalizeDeal(property.id);
          console.log('ðŸ¤ Deal response:', response);
          
          if (response.status === 'success') {
            console.log('ðŸ¤ Updating property deal status');
            setProperties(prev => prev.map(p =>
              p.id === property.id
                ? { ...p, dealStatus: 'closed', closingData: response.data }
                : p
            ));
            
            setSnackbar({ 
              open: true, 
              message: 'ðŸŽ‰ Congratulations! Deal successfully closed!', 
              severity: 'success' 
            });
          }
          break;
          
        case 'viewDetails':
          console.log('ðŸ‘€ Viewing details for property:', property.id);
          setSelectedProperty(property);
          setShowPropertyDetails(true);
          break;
          
        default:
          console.warn('â“ Unknown action:', action);
          break;
      }
    } catch (error) {
      console.error('ðŸ’¥ Property action error:', error);
      setSnackbar({ 
        open: true, 
        message: 'Action failed. Please try again.', 
        severity: 'error' 
      });
    }
  };

  const handleSuggestionClick = (suggestion) => {
    console.log('ðŸ’¡ Suggestion clicked:', suggestion);
    
    // Convert suggestion to a searchable query
    let query = '';
    if (suggestion.includes('budget')) {
      query = input.replace(/under \$\d+K?/i, 'under $600K');
    } else if (suggestion.includes('nearby')) {
      query = input.replace(/in \w+( \w+)?/i, 'in nearby areas');
    } else {
      query = suggestion;
    }
    
    setInput(query);
  };

  const PropertyCard = ({ property }) => {
    console.log('ðŸŽ´ Rendering PropertyCard for:', property.id);
    
    return (
      <Card 
        sx={{ 
          mb: 2, 
          borderLeft: property.dealStatus === 'closed' 
            ? '4px solid #4caf50' 
            : property.isAlternative 
              ? '4px solid #ff9800' 
              : '4px solid #2196f3',
          opacity: property.dealStatus === 'closed' ? 0.8 : 1,
          position: 'relative'
        }}
      >
        {property.isAlternative && (
          <Chip 
            label="Similar Property" 
            size="small" 
            color="warning" 
            sx={{ position: 'absolute', top: 8, right: 8, zIndex: 1 }}
          />
        )}
        
        <CardContent>
          <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start', mb: 2 }}>
            <Typography variant="h6" component="div" sx={{ flexGrow: 1, pr: 2 }}>
              ðŸ  {property.address}
            </Typography>
            {property.dealStatus === 'closed' && (
              <Chip label="SOLD" color="success" size="small" />
            )}
          </Box>
          
          <Typography color="text.secondary" sx={{ mb: 1 }}>
            ðŸ“ {property.city}, {property.state}
          </Typography>

          <Grid container spacing={2} sx={{ mb: 2 }}>
            <Grid item xs={6} sm={3}>
              <Typography variant="h6" color="success.main">
                ðŸ’° ${property.price.toLocaleString()}
              </Typography>
            </Grid>
            <Grid item xs={6} sm={3}>
              <Typography>ðŸ›ï¸ {property.bedrooms} bed</Typography>
            </Grid>
            <Grid item xs={6} sm={3}>
              <Typography>ðŸ› {property.bathrooms} bath</Typography>
            </Grid>
            <Grid item xs={6} sm={3}>
              <Typography>ðŸ“ {property.square_feet?.toLocaleString()} sqft</Typography>
            </Grid>
          </Grid>

          <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 1, mb: 2 }}>
            <Chip label={property.property_type} variant="outlined" size="small" />
            {property.is_pet_friendly && (
              <Chip label="ðŸ• Pet Friendly" variant="outlined" size="small" color="secondary" />
            )}
            {property.year_built && (
              <Chip label={`Built ${property.year_built}`} variant="outlined" size="small" />
            )}
          </Box>

          {property.showAmenities && property.amenitiesData && (
            <Box sx={{ mt: 2, p: 2, bgcolor: 'grey.50', borderRadius: 1 }}>
              <Typography variant="subtitle2" sx={{ mb: 1, fontWeight: 'bold' }}>
                ðŸ¢ Property Amenities:
              </Typography>
              {property.amenitiesData.amenities && (
                <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 0.5 }}>
                  {property.amenitiesData.amenities.map((amenity, index) => (
                    <Chip key={index} label={amenity} size="small" variant="outlined" />
                  ))}
                </Box>
              )}
            </Box>
          )}

          {property.negotiationData && (
            <Alert 
              severity={property.negotiationData.negotiation_status === 'accepted' ? 'success' : 'info'}
              sx={{ mt: 2 }}
            >
              <strong>Negotiation Update:</strong> {property.negotiationData.message || 'Offer under review'}
              {property.negotiationData.counter_offer && (
                <Typography variant="body2" sx={{ mt: 1 }}>
                  Counter Offer: ${property.negotiationData.counter_offer.toLocaleString()}
                </Typography>
              )}
            </Alert>
          )}
        </CardContent>

        <CardActions sx={{ flexWrap: 'wrap', gap: 1 }}>
          <Button size="small" onClick={() => handlePropertyAction(property, 'viewDetails')}>
            â„¹ï¸ View Details
          </Button>
          
          <Button size="small" onClick={() => handlePropertyAction(property, 'showAmenities')}>
            {property.showAmenities ? 'ðŸ”½ Hide Amenities' : 'ðŸ”¼ Show Amenities'}
          </Button>

          {property.dealStatus !== 'closed' && (
            <>
              <Button
                size="small"
                variant="contained"
                onClick={() => handlePropertyAction(property, 'makeOffer')}
              >
                ðŸ’° Make Offer
              </Button>

              {property.negotiationStatus === 'accepted' && (
                <Button
                  size="small"
                  color="success"
                  variant="contained"
                  onClick={() => handlePropertyAction(property, 'closeDeal')}
                >
                  âœ… Close Deal
                </Button>
              )}
              
              {property.negotiationStatus === 'counter_offered' && (
                <Button
                  size="small"
                  color="warning"
                  variant="contained"
                  onClick={() => handlePropertyAction(property, 'negotiate', { 
                    offer: property.negotiationData?.counter_offer 
                  })}
                >
                  ðŸ¤ Accept Counter
                </Button>
              )}
            </>
          )}
        </CardActions>
      </Card>
    );
  };

  console.log('ðŸŽ¨ Rendering ChatInterface component');
  console.log('ðŸŽ¨ Current state - messages:', messages.length);
  console.log('ðŸŽ¨ Current state - properties:', properties.length);
  console.log('ðŸŽ¨ Current state - loading:', loading);

  return (
    <Container maxWidth="lg">
      <Box sx={{ height: '100vh', py: 2, display: 'flex', flexDirection: 'column' }}>
        <Paper elevation={3} sx={{ flexGrow: 1, display: 'flex', flexDirection: 'column', borderRadius: 2, overflow: 'hidden' }}>
          
          {/* Header */}
          <Box sx={{ p: 2, bgcolor: 'primary.main', color: 'white', display: 'flex', alignItems: 'center', justifyContent: 'space-between' }}>
            <Typography variant="h6">ðŸ  AI Real Estate Assistant</Typography>
            {properties.length > 0 && (
              <Badge badgeContent={properties.length} color="secondary">
                <Typography variant="body2">Properties</Typography>
              </Badge>
            )}
          </Box>

          {/* Messages Area */}
          <Box sx={{ flexGrow: 1, overflow: 'auto', p: 2, display: 'flex', flexDirection: 'column' }}>
            {messages.map((message) => {
              console.log('ðŸ’¬ Rendering message:', message.id, message.sender);
              return (
                <Box
                  key={message.id}
                  sx={{
                    display: 'flex',
                    justifyContent: message.sender === 'user' ? 'flex-end' : 'flex-start',
                    mb: 2,
                    alignItems: 'flex-start'
                  }}
                >
                  {message.sender === 'agent' && (
                    <Avatar sx={{ bgcolor: 'secondary.main', width: 32, height: 32, mr: 1, mt: 0.5 }}>
                      AI
                    </Avatar>
                  )}
                  
                  <Paper
                    sx={{
                      p: 2,
                      backgroundColor: message.sender === 'user' 
                        ? 'primary.light' 
                        : message.status === 'error' 
                          ? 'error.light'
                          : message.type === 'alternatives'
                            ? 'warning.light'
                            : 'grey.100',
                      color: message.sender === 'user' ? 'white' : 'text.primary',
                      maxWidth: '80%',
                      borderRadius: 2,
                      whiteSpace: 'pre-line'
                    }}
                  >
                    <Typography variant="body1">{message.text}</Typography>
                  </Paper>

                  {message.sender === 'user' && (
                    <Avatar sx={{ bgcolor: 'primary.main', width: 32, height: 32, ml: 1, mt: 0.5 }}>
                      U
                    </Avatar>
                  )}
                </Box>
              );
            })}
            <div ref={messagesEndRef} />
          </Box>

          {/* Search Suggestions */}
          {searchSuggestions.length > 0 && properties.length === 0 && (
            <Box sx={{ px: 2, pb: 1 }}>
              <Typography variant="subtitle2" sx={{ mb: 1, fontWeight: 'bold' }}>
                ðŸ’¡ Try these suggestions:
              </Typography>
              <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 1 }}>
                {searchSuggestions.map((suggestion, index) => (
                  <Chip
                    key={index}
                    label={suggestion}
                    variant="outlined"
                    size="small"
                    clickable
                    onClick={() => handleSuggestionClick(suggestion)}
                    sx={{ cursor: 'pointer' }}
                  />
                ))}
              </Box>
            </Box>
          )}

          {/* Properties Display */}
          {properties.length > 0 && (
            <Box sx={{ maxHeight: '400px', overflow: 'auto', px: 2, pb: 2 }}>
              <Divider sx={{ mb: 2 }} />
              <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between', mb: 2 }}>
                <Typography variant="h6">
                  ðŸ  {properties.some(p => p.isAlternative) ? 'Similar' : 'Found'} Properties ({properties.length}):
                </Typography>
                {properties.some(p => p.isAlternative) && (
                  <Chip label="Alternative Results" color="warning" size="small" />
                )}
              </Box>
              {properties.map((property) => {
                console.log('ðŸ  Rendering property card:', property.id);
                return <PropertyCard key={property.id} property={property} />;
              })}
            </Box>
          )}

          {/* Input Area */}
          <Box sx={{ p: 2, borderTop: '1px solid', borderColor: 'divider' }}>
            <Box component="form" onSubmit={handleSubmit} sx={{ display: 'flex', gap: 1 }}>
              <TextField
                fullWidth
                value={input}
                onChange={(e) => {
                  console.log('âœï¸ Input changed:', e.target.value);
                  setInput(e.target.value);
                }}
                placeholder="Ask me about properties, amenities, negotiations, or closing deals..."
                disabled={loading}
                variant="outlined"
                size="small"
                multiline
                maxRows={3}
              />
              <Button 
                type="submit" 
                variant="contained" 
                disabled={loading || !input.trim()}
                sx={{ minWidth: 'auto', px: 2 }}
                onClick={() => console.log('ðŸ”˜ Submit button clicked')}
              >
                {loading ? <CircularProgress size={24} /> : 'ðŸ“¤'}
              </Button>
            </Box>
            
            <Box sx={{ mt: 1, display: 'flex', flexWrap: 'wrap', gap: 1 }}>
              <Chip 
                label="ðŸ” Search Dallas Properties" 
                size="small" 
                clickable 
                onClick={() => {
                  console.log('ðŸ” Quick search clicked');
                  setInput("Find 2BHK apartments in Dallas under $500K");
                }}
              />
              <Chip 
                label="ðŸ• Pet-Friendly Options" 
                size="small" 
                clickable 
                onClick={() => {
                  console.log('ðŸ• Pet-friendly clicked');
                  setInput("Show pet-friendly properties");
                }}
              />
              <Chip 
                label="âœ¨ Luxury Properties" 
                size="small" 
                clickable 
                onClick={() => {
                  console.log('âœ¨ Luxury clicked');
                  setInput("Find luxury condos with amenities");
                }}
              />
              <Chip 
                label="ðŸ  General Search" 
                size="small" 
                clickable 
                onClick={() => {
                  console.log('ðŸ  General search clicked');
                  setInput("Show me available 2 bedroom apartments");
                }}
              />
            </Box>
          </Box>
        </Paper>

        {/* Property Details Modal */}
        <Dialog open={showPropertyDetails} onClose={() => setShowPropertyDetails(false)} maxWidth="md" fullWidth>
          <DialogTitle>Property Details</DialogTitle>
          <DialogContent>
            {selectedProperty && (
              <Box>
                <Typography variant="h6">{selectedProperty.address}</Typography>
                <Typography color="text.secondary" sx={{ mb: 2 }}>
                  {selectedProperty.city}, {selectedProperty.state}
                </Typography>
                
                <Grid container spacing={2}>
                  <Grid item xs={12} sm={6}>
                    <List dense>
                      <ListItem>
                        <ListItemText primary="ðŸ’° Price" secondary={`$${selectedProperty.price.toLocaleString()}`} />
                      </ListItem>
                      <ListItem>
                        <ListItemText primary="ðŸ›ï¸ Bedrooms" secondary={selectedProperty.bedrooms} />
                      </ListItem>
                      <ListItem>
                        <ListItemText primary="ðŸ› Bathrooms" secondary={selectedProperty.bathrooms} />
                      </ListItem>
                    </List>
                  </Grid>
                  <Grid item xs={12} sm={6}>
                    <List dense>
                      <ListItem>
                        <ListItemText primary="ðŸ“ Square Feet" secondary={selectedProperty.square_feet?.toLocaleString()} />
                      </ListItem>
                      <ListItem>
                        <ListItemText primary="ðŸ  Property Type" secondary={selectedProperty.property_type} />
                      </ListItem>
                      <ListItem>
                        <ListItemText primary="ðŸ• Pet Friendly" secondary={selectedProperty.is_pet_friendly ? 'Yes' : 'No'} />
                      </ListItem>
                    </List>
                  </Grid>
                </Grid>

                {/* Nearby Amenities */}
                {selectedProperty.nearby_amenities && Object.keys(selectedProperty.nearby_amenities).length > 0 && (
                  <Box sx={{ mt: 2 }}>
                    <Typography variant="h6" sx={{ mb: 1 }}>Nearby Amenities:</Typography>
                    <Grid container spacing={1}>
                      {Object.entries(selectedProperty.nearby_amenities).map(([category, info]) => (
                        <Grid item xs={12} sm={6} key={category}>
                          <Typography variant="body2">
                            <strong>{category.charAt(0).toUpperCase() + category.slice(1)}:</strong> {info.name} ({info.distance} mi)
                          </Typography>
                        </Grid>
                      ))}
                    </Grid>
                  </Box>
                )}
              </Box>
            )}
          </DialogContent>
          <DialogActions>
            <Button onClick={() => setShowPropertyDetails(false)}>Close</Button>
            {selectedProperty && (
              <Button 
                variant="contained" 
                onClick={() => {
                  setShowPropertyDetails(false);
                  handlePropertyAction(selectedProperty, 'makeOffer');
                }}
              >
                Make Offer
              </Button>
            )}
          </DialogActions>
        </Dialog>

        {/* Snackbar for notifications */}
        <Snackbar
          open={snackbar.open}
          autoHideDuration={6000}
          onClose={() => setSnackbar({ ...snackbar, open: false })}
        >
          <Alert onClose={() => setSnackbar({ ...snackbar, open: false })} severity={snackbar.severity} sx={{ width: '100%' }}>
            {snackbar.message}
          </Alert>
        </Snackbar>
      </Box>
    </Container>
  );
};

console.log('ðŸŽ¨ ChatInterface component defined, exporting...');
export default ChatInterface;
